module.exports = /*#__PURE__*/JSON.parse('{"title":"         Entrepreneuriat","quote":"Ce ne sont pas les études de marché sur la lampe à huile qui ont permis l’invention de l’électricité.","intro":"La rareté et la précarité de l’emploi salarié poussent, et continuent de pousser, de plus en plus de jeunes diplômés camerounais à opter pour l’entrepreneuriat. Toutefois, nous suggérons vivement à toutes celles et tous ceux qui veulent se lancer de bien s’y préparer au risque de voir leur projet péricliter dès les premiers mois.","intro2":"Ci-dessous <b> l’essentiel de ce qu’il faut savoir et faire avant d’entreprendre</b>.","content1":{"title":"Choses à savoir et à faire avant de créer son entreprise","intro":" Plus de 90% des start-ups camerounaises font faillite au cours des deux premières années d’existence. </b>Si vous ne voulez pas contribuer à faire grossir ce chiffre, avant de vous lancer prenez préalablement le temps et le soin de :","item1":"  <b>Bien évaluer  </b> votre potentiel d’entrepreneur : à travers un bilan de compétences (savoirs, savoir-faire, savoir-être, motivations, réseau relationnel, etc.) ;","item2":"  <b> Mûrir </b>votre projet ou idée d’entreprise ;","item3":"    <b> Bien vous renseigner </b>sur votre marché : taille, cible, chiffre d’affaires, concurrence, réglementation, etc. ;","item4":"<b> D’élaborer</b> au besoin un Business Model Canvas (Matrice d’affaires) et/ou un Business plan (Plan d’affaires) exposant votre business model ;","item5":" <b> Avoir développé et posséder </b> les qualités essentielles de l’entrepreneur ; un mentor ou coach peut vous y aider !","item6":" <b>D’acquérir </b> de bonnes notions en gestion et comptabilité ;","item7":"  <b>Vous être informé </b> sur le cadre législatif et réglementaire relatif à la création et à l’accompagnement des PME ;","item8":" <b>Constituer si possible un capital d’investissement  </b> et de vous être informé sur les sources de financement possibles de vos activités ;","item9":" <b> Planifier minutieusement </b> la mise en œuvre de votre plan d’actions contenant les objectifs (hebdomadaires, mensuels…) à atteindre ;","item10":"  <b>Préparer un plan B  </b> en cas d’échec.","maniere":" <p> De manière plus concrète, il s’agira pour vous :</p>","maniere1":"d’avoir ou de développer une idée originale (d’un produit ou service résolvant un problème ou répondant à un besoin) ainsi qu’un « business model » savamment pensé ;","maniere2":"de bien calculer toutes vos charges en prenant en compte les imprévus ;","maniere3":"d’estimer de manière réaliste le produit de vos ventes (à partir d’estimations basses).","conclusion":" Si votre résultat est largement bénéficiaire, il y a de fortes chances que votre affaire soit rentable et pérenne.","majorite":"Enfin, sachez que la majorité des grands entrepreneurs à succès :","majorite1":"ne cite pas la quête du gain (devenir riche) comme moteur principal de leur action mais la passion pour ce qu’ils font et la volonté de rendre meilleur le monde.","majorite2":"Le milliardaire Dietrich Mateschitz, 1ère fortune d’Autriche et cocréateur de la boisson énergisante Red Bull, déclare ainsi dans une de ses rares interviews que l’argent n’a jamais été un moteur pour lui. Mais plutôt la liberté, l’indépendance et la passion pour ses projets.","majorite3":"n’a pas essayé de tout anticiper ou attendu que tout soit prêt ;","majorite4":" Ils sont passés à l’action dès que possible et ont progressé en apprenant de leurs erreurs."}}');

